import React, { useState, useEffect } from "react";

export default function Videos({ videos }) {
  return (
    <div>
      {videos &&
        videos.map((v) => {
          return (
            <video width="300" controls>
              <source src={v.uri}></source>
            </video>
          );
        })}
    </div>
  );
}
